import React from 'react'
// import { Link } from 'react-router-dom'
// import productSchema from '../../../api/models/products/productSchema'

const Detaljsida = () => {
  return (
    <div class="container w-75">
    <div class="card text-center bg-dark">
    <img src="https://mdbcdn.b-cdn.net/img/new/standard/nature/184.webp" class="card-img-top w-50 m-2 d-flex justify-content-center" alt="Fissure in Sandstone"/>
    <div class="card-body m-2">
      <h5 class="card-title text-light">Product name</h5>
      <p class="card-text text-light">Description of the product</p>
      <p class="card-text text-warning">Price SEK</p>
      <a href="#!" class="btn btn-primary">Add to cart</a>
      {/* <button className='btn btn-info' onClick={() => dispatch(addToCart(product))}>Add To Cart</button> */}
    </div>
  </div>
  </div>
 
  )
}

export default Detaljsida
